import React from 'react';
import ReactDOM from 'react-dom';
import App from './App';
import './styles.css'; // Ensure this path is correct

ReactDOM.render(
    <React.StrictMode>
        <App />
    </React.StrictMode>,
    document.getElementById('root') // This should match the id in index.html
);
